import React, { useState, useEffect } from 'react';

const JobList = () => {
    const [jobs, setJobList] = useState([]);

    useEffect(() => {
        fetch('/search')
        .then(response => response.json())
        .then(data => {setJobList(data);});
    }, []);

    console.log(jobs);

    return (
        <div>
                {jobs.map(job => (
                        <tbody style={innerWidth=100}>
                            <tr key={job.id}>
                                <td>{job.id}</td>
                                <td>{job.username}</td>
                                <td>{job.animal}</td>
                            </tr>
                        </tbody>
                ))}
        </div>
    );
}

export default JobList;
